$.fn.extend({treed:function(d){var b="glyphicon-minus-sign";var c="glyphicon-plus-sign";if(typeof d!="undefined"){if(typeof d.openedClass!="undefined"){b=d.openedClass}if(typeof d.closedClass!="undefined"){c=d.closedClass}}var a=$(this);a.addClass("tree");a.find("li").has("ul").each(function(){var e=$(this);e.prepend("<i class='indicator glyphicon "+c+"'></i>");e.addClass("branch");e.on("click",function(g){if(this==g.target){var f=$(this).children("i:first");f.toggleClass(b+" "+c);$(this).children().children().toggle()}});e.children().children().toggle()});a.find(".branch .indicator").each(function(){$(this).on("click",function(){$(this).closest("li").click()})});a.find(".branch>a").each(function(){$(this).on("click",function(f){$(this).closest("li").click();f.preventDefault()})});a.find(".branch>button").each(function(){$(this).on("click",function(f){$(this).closest("li").click();f.preventDefault()})})}});